import './Navbar.css';
import React, { Component } from "react";
import {
    BrowserRouter as Router,
    Link
} from "react-router-dom";

class Navbar extends React.Component {
    render() {
        return (
            <Router>
                <div className="Navbar">
                    <nav>
                    <ul>
                        <li>
                        <Link to="/">Home</Link>
                        </li>
                        <li>
                        <Link to="/">All Modules</Link>
                        </li>
                        <li>

                        <Link to="/">Builder</Link>
                        </li>
                    </ul>
                    </nav>

                </div>
            </Router>
        )
    }
}

export default Navbar;
